import logo from "./logo.svg";
import "./App.css";
import Header from "./components/header";
import Footer from "./components/footer";
import ContainerChamp from "./components/containerchamp";
import Search from "./components/search";

import React, { useState } from "react";

function App() {
  const [champ, setChamp] = useState(false);

  const ListChamp = () =>{
    setChamp(true)
    setSearch(false)
  }
  const [search, setSearch] = useState(false);

  const busca = () =>{
    setSearch(true)
    setChamp(false)
  }

  return (
    <div className="App">
      <Header />
      <nav id="menu">
        <ul>
            <li><a href="#menu" onClick={ListChamp}>  Campeoes  </a></li>
            <li><a href="#menu" onClick={busca}>  Items  </a></li>
            <li><a href="#menu">  Runas  </a></li>
            <li><a href="#menu">  Buscar </a></li>

        </ul>
        </nav>
          {
            champ && <ContainerChamp />
          }
          {
            search && <search/>
          }

      <Footer />
    </div>
  );
}

export default App;
